import React, { Component } from 'react'
import Loader from './Loader';

export class Result extends Component {
  constructor(props){
    super()
  }
  render() {

    let ShowData;

    if(this.props.weatherData === null){
      ShowData = <Loader></Loader>
    }else{
      ShowData = (
      <div className=''>
        <table className="mx-auto w-75">
            <h2>Utran haze</h2>
            <tr>
                <td>Feels Like</td>
                <td></td>
            </tr>
            <tr>
                <td>Min.Temp</td>
                <td></td>
            </tr>
            <tr>
                <td>Max.Temp</td>
                <td></td>
            </tr>
            <tr>
                <td>Sun Rise</td>
                <td></td>
            </tr>
            <tr>
                <td>Sun Set</td>
                <td></td>
            </tr>
        </table>
        </div>
      )
    }
    return (
      <div>
        {ShowData}
      </div>
    )
  }
}

export default Result
